import { createFeatureSelector, createSelector } from '@ngrx/store';
import { AppState } from '../app.state';
import { IgracState } from './igrac.reducer';

export const selectIgracState = createFeatureSelector<AppState, IgracState>('igraci');

export const selectSelectedPlayerIdOut = createSelector(
  selectIgracState,
  (state) => state.selectedPlayerIdOut
);

export const selectSelectedPlayerIdIn = createSelector(
  selectIgracState,
  (state) => state.selectedPlayerIdIn
);

